import React from 'react';

import NavBar from '../NavBar/NavBar';
import LoginBox from '../LoginBox/LoginBox';

const LoginContainer = () => {
    return (
        <div className="login-container">
            <NavBar/>
            <LoginBox />
        </div>
    )
};

export default LoginContainer;
